import React from 'react';
import './Rect.css';

function Rectangle() {
    return (
        <div>
            <button
                    style={{
                        marginTop: '160px'
                    }}
                    onClick={() => alert('Button clicked')}>
                    click
                </button>
        </div>


    )
}
export default Rectangle
